import { Row } from "react-bootstrap";
import Note from "./Note";

const ListNotes =(props)=> {
    const {data} = props;

    return(
        <Row xs={1} md={2} lg={3} >
            {
                data.map(
                    (i, index)=>(
                      <Note data={i} index={index} editNote={editNote} deleteNote={deleteNote} />
                    )
                )
            }
        </Row>
    );
}

export default ListNotes;
